const rangeSlider=document.getElementById("range-slider");if(rangeSlider){noUiSlider.create(rangeSlider,{start:[0,15e3],connect:!0,step:100,range:{min:[0],max:[2e4]}});const e=[document.getElementById("input-0"),document.getElementById("input-1")];rangeSlider.noUiSlider.on("update",function(n,t){e[t].value=Math.round(n[t])});const n=(e,n)=>{let t=[null,null];t[e]=n,rangeSlider.noUiSlider.set(t)};e.forEach((e,t)=>{e.addEventListener("change",e=>{n(t,e.currentTarget.value)})})}